using System;
using Sys = Cosmos.System;
using Cosmos.TestRunner;
using Cosmos.System.Graphics;
using System.Drawing;
using Point = Cosmos.System.Graphics.Point;
using System.IO;
using Cosmos.Compiler.Tests.Bcl;
using Cosmos.System.Graphics.Fonts;
using Cosmos.Debug.Kernel;
using Cosmos.Core.Memory;

/*
 * It is impossible to make assertions here but it is useful in any case to have it runs automatically
 * to catch stack overflows / corruptions when the CGS code is modified.
 */
namespace GraphicTest
{
    public class Kernel : Sys.Kernel
    {
        private readonly Bitmap bitmap = new Bitmap(10, 10,
                Content.bitmap, ColorDepth.ColorDepth32);

        private readonly Bitmap letter = new Bitmap(Content.letterData);
        
        protected override void BeforeRun()
        {
        }

        private void DoTest(ICanvas aCanvas)
        {
            mDebugger.Send($"Testing Canvas ({ aCanvas.Name() }) with mode {aCanvas.Mode}");
            aCanvas.Clear(Color.Blue);

            /* A red Point */
            Pen pen = new Pen(Color.Red);
            aCanvas.DrawPoint(pen, 69, 69);

            Color color = aCanvas.GetPointColor(69, 69);
            Assert.AreEqual(color.ToArgb(), Color.Red.ToArgb(), "GetPointColor returns correct value");

            /* A GreenYellow horizontal line */
            pen.Color = Color.GreenYellow;
            aCanvas.DrawLine(pen, 250, 100, 400, 100);

            /* A Black Lines larger than the canvas */
            pen.Color = Color.Black;
            aCanvas.DrawLine(pen, -20, 100, aCanvas.Mode.Columns + 20, 100);
            aCanvas.DrawLine(pen, -20, -20, aCanvas.Mode.Columns + 20, aCanvas.Mode.Rows + 20);

            /* An IndianRed vertical line */
            pen.Color = Color.IndianRed;
            aCanvas.DrawLine(pen, 350, 150, 350, 250);

            /* A MintCream diagonal line */
            pen.Color = Color.MintCream;
            aCanvas.DrawLine(pen, 250, 150, 400, 250);

            /* Rectangles of various colors */
            pen.Color = Color.PaleVioletRed;
            aCanvas.DrawRectangle(pen, 350, 350, 80, 60);

            pen.Color = Color.Chartreuse;
            aCanvas.DrawCircle(pen, 69, 69, 10);

            pen.Color = Color.DimGray;
            aCanvas.DrawEllipse(pen, 100, 69, 10, 50);

            pen.Color = Color.MediumPurple;
            aCanvas.DrawPolygon(pen, new Point(200, 250), new Point(250, 300), new Point(220, 350), new Point(210, 275));

            /* Color.FromName */
            aCanvas.Clear(Color.FromName("Navy"));
            
            /* A LimeGreen rectangle */
            pen.Color = Color.LimeGreen;
            aCanvas.DrawRectangle(pen, 450, 300, 80, 60);

            /* A filled rectange */
            pen.Color = Color.Chocolate;
            aCanvas.DrawFilledRectangle(pen, 200, 150, 400, 300);

            /* A Bitmap image */
            aCanvas.DrawImage(bitmap, new Point(10, 10));
            aCanvas.DrawImage(letter, new Point(50, 10));

            /* Drawing BitmapHeaderV5 image */
            Bitmap v5header = new Bitmap(Convert.FromBase64String(Content.parrot));
            aCanvas.DrawImage(v5header,0,0);
            /* Drawing three bitmap images */
            // Image Credit chathurax
            Bitmap bitmap2 = new Bitmap(Convert.FromBase64String("" +
                "" +
                "" +
                "" +
                "" +
                "" +
                "" +
                "" +
                ""));

            //image with alpha channel
            Bitmap bitmap3 = new Bitmap(Convert.FromBase64String("" +
                "" +
                ""));

            aCanvas.DrawImage(bitmap, new Point(0, 0));
            aCanvas.DrawImage(bitmap2, new Point(200, 0));
            //Scale Bitmap
            aCanvas.DrawImage(bitmap,0,0,50,50);
            
            aCanvas.DrawImageAlpha(bitmap3, new Point(0, 300));

            /* Drawing ellipses */
            aCanvas.DrawEllipse(pen, 100, 69, 10, 50);
            aCanvas.DrawEllipse(pen, 100, 69, 10, 50);
            aCanvas.DrawEllipse(pen, 100, 69, 10, 50);

            /* Create a PC Screen Font */
            pen = new Pen(Color.White);
            Font font = PCScreenFont.Default;

            /* Draw text */
            aCanvas.DrawString("Hello Cosmos World!", font, pen, 0, 16 * 5);
            aCanvas.DrawString("font data test=" + font.Width + "x" + font.Height, font, pen, 0, 16 * 6);

            /* Draw char */
            aCanvas.DrawChar('A', font, pen, 0, 16 * 7);

            aCanvas.Display();

            aCanvas.Disable();

            Console.WriteLine("Back in text mode");
            Console.WriteLine("Freed: " + Heap.Collect());

            mDebugger.Send($"Test of Canvas with mode {aCanvas.Mode} executed successfully");
        }

        protected override void Run()
        {
            mDebugger.Send("Run");


            //Test changing font
            PCScreenFont screenFont = PCScreenFont.Default;
            VGAScreen.SetFont(screenFont.CreateVGAFont(), screenFont.Height);
            Console.WriteLine("ABAKDSKDNKSNJNFJGNFLPÜQOJOPJD");
            Console.WriteLine("I(39u0pwoejJIosjfppkspjfsdjfp");

            TestBitmaps();

            /* First test with the DefaultMode */
            ICanvas canvas = FullScreenCanvas.GetFullScreenCanvas();
            DoTest(canvas);

            DoTest(FullScreenCanvas.GetFullScreenCanvas(new Mode(800, 600, ColorDepth.ColorDepth32)));
            DoTest(FullScreenCanvas.GetFullScreenCanvas(new Mode(1024, 768, ColorDepth.ColorDepth32)));
            DoTest(FullScreenCanvas.GetFullScreenCanvas(new Mode(1280, 1024, ColorDepth.ColorDepth32)));
            DoTest(FullScreenCanvas.GetFullScreenCanvas(new Mode(1280, 720, ColorDepth.ColorDepth32)));

            VGACanvas vGACanvas = new VGACanvas();
            vGACanvas.Init(new Mode(320, 200, ColorDepth.ColorDepth8));
            DoVGATest(vGACanvas);
            vGACanvas = new VGACanvas();
            vGACanvas.Init(new Mode(720, 480, ColorDepth.ColorDepth4));
            DoVGATest(vGACanvas);
            vGACanvas = new VGACanvas();
            vGACanvas.Init(new Mode(640, 480, ColorDepth.ColorDepth4));
            DoVGATest(vGACanvas);
            Console.BackgroundColor = ConsoleColor.Black;
            for (int i = 0; i < 16; i++)
            {
                Console.ForegroundColor = (ConsoleColor)i; //Ensure that the correct coloures are used
                Console.WriteLine("Back in text mode 2");
            }
            Console.ForegroundColor = ConsoleColor.White;
                
            TestController.Completed();
        }

        private void DoVGATest(VGACanvas vGACanvas)
        {
            mDebugger.Send($"Testing VGA Canvas with mode {vGACanvas.Mode}");
            vGACanvas.Clear(Color.Wheat);
            for (int x = 0; x < 20; x++)
            {
                for (int y = 0; y < 20; y++)
                {
                    vGACanvas.DrawPoint((uint)(x % (2 << ((int)vGACanvas.Mode.ColorDepth - 1))), 5 + x, 5 + y);
                }
            }

            for (int x = 0; x < 20; x++)
            {
                for (int y = 0; y < 20; y++)
                {
                    vGACanvas.DrawPoint((uint)(x % (2 << ((int)vGACanvas.Mode.ColorDepth - 1))), 25 + x, 5 + y);
                }
            }

            vGACanvas.DrawLine(new Pen(Color.Red), 10, 10, 10, 50);

            vGACanvas.Disable();
            for (int i = 0; i < 10; i++)
            {
                Console.WriteLine("Back in text mode");
            }

            mDebugger.Send($"Test of Canvas with mode {vGACanvas.Mode} executed successfully");
        }

        private void TestBitmaps()
        {
            Assert.IsTrue(bitmap.Width == 10 && bitmap.Height == 10, "Bitmap width and height set correctly");
            Assert.IsTrue(bitmap.rawData.Length == 100, "Bitmap data size makes sense");
            MemoryStream savedBitmap = new MemoryStream();
            letter.Save(savedBitmap, ImageFormat.bmp);
            var bitmapData = savedBitmap.ToArray();
            Assert.IsTrue(EqualityHelper.ByteArrayAreEquals(bitmapData, Content.letterData), "Saving a bitmap creates the same data as used to create it");
            Bitmap letter2 = new Bitmap(bitmapData);
            Assert.IsTrue(EqualityHelper.IntArrayAreEquals(letter2.rawData, letter.rawData), "Creating a new bitmap from saved bitmap creates same bitmap");
        }
    }
}
